import React from "react";
import { useState, useEffect } from "react";

function Codeforces() {
  const [user, setuser] = useState([]);

  const getUser = async () => {
    const respone = await fetch(
      `https://codeforces.com/api/user.rating?handle=Hustlingbeast_Anish`
    );
    setuser(await respone.json());
  };

  useEffect(() => {
    getUser();
  }, []);

  return (
    <>
      <div className="container">
        <h2>Codeforces Stats</h2>
        <div className="container">
          {user.map(() => {
            return (
              <div className="container d-flex">
                <div class="card w-50 m-3">
                  <div class="card-body">
                    <h5 class="card-title">User Rating</h5>

                    <p class="card-text"></p>
                  </div>
                </div>
              </div>
            );
          })}
        </div>
      </div>
    </>
  );
}

export default Codeforces;
